import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { CssBaseline, Box } from '@mui/material';
import Navbar from './components/Navbar';
import Dashboard from './components/Dashboard';
import LogUpload from './components/LogUpload';
import RuleManagement from './components/RuleManagement';
import IaCScanner from './components/IaCScanner';

// Hand-Drawn Design System
const handDrawnTheme = createTheme({
  palette: {
    mode: 'light',
    primary: {
      main: '#ff4d4d', // Red Correction Marker
    },
    secondary: {
      main: '#2d5da1', // Blue Ballpoint Pen
    },
    background: {
      default: '#fdfbf7', // Warm Paper
      paper: '#ffffff', // White Paper
    },
    text: {
      primary: '#2d2d2d', // Soft Pencil Black
      secondary: '#2d2d2d', // Consistent with foreground
    },
    divider: '#e5e0d8', // Old Paper / Erased Pencil
  },
  typography: {
    fontFamily: '"Patrick Hand", cursive',
    h1: {
      fontFamily: '"Kalam", cursive',
      fontWeight: 700,
      fontSize: '3rem',
      lineHeight: 1.2,
    },
    h2: {
      fontFamily: '"Kalam", cursive',
      fontWeight: 700,
      fontSize: '2.5rem',
      lineHeight: 1.3,
    },
    h3: {
      fontFamily: '"Kalam", cursive',
      fontWeight: 700,
      fontSize: '2rem',
      lineHeight: 1.3,
    },
    h4: {
      fontFamily: '"Kalam", cursive',
      fontWeight: 700,
      fontSize: '1.75rem',
      lineHeight: 1.4,
    },
    h5: {
      fontFamily: '"Kalam", cursive',
      fontWeight: 700,
      fontSize: '1.5rem',
      lineHeight: 1.4,
    },
    h6: {
      fontFamily: '"Kalam", cursive',
      fontWeight: 700,
      fontSize: '1.25rem',
      lineHeight: 1.4,
    },
    body1: {
      fontFamily: '"Patrick Hand", cursive',
      fontSize: '1.125rem',
      lineHeight: 1.6,
    },
    body2: {
      fontFamily: '"Patrick Hand", cursive',
      fontSize: '1rem',
      lineHeight: 1.6,
    },
    button: {
      fontFamily: '"Patrick Hand", cursive',
      fontSize: '1.125rem',
      textTransform: 'none',
    },
  },
  shape: {
    borderRadius: 0, // Will be overridden with wobbly borders
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          borderRadius: '255px 15px 225px 15px / 15px 225px 15px 255px',
          textTransform: 'none',
          fontFamily: '"Patrick Hand", cursive',
          fontSize: '1.125rem',
          fontWeight: 400,
          minHeight: 48,
          border: '3px solid #2d2d2d',
          boxShadow: '4px 4px 0px 0px #2d2d2d',
          transition: 'all 0.1s ease',
          '&:hover': {
            backgroundColor: '#ff4d4d',
            color: '#ffffff',
            boxShadow: '2px 2px 0px 0px #2d2d2d',
            transform: 'translate(2px, 2px)',
          },
          '&:active': {
            boxShadow: 'none',
            transform: 'translate(4px, 4px)',
          },
        },
        contained: {
          backgroundColor: '#ffffff',
          color: '#2d2d2d',
          '&:hover': {
            backgroundColor: '#ff4d4d',
            color: '#ffffff',
          },
        },
        outlined: {
          backgroundColor: '#e5e0d8',
          color: '#2d2d2d',
          '&:hover': {
            backgroundColor: '#2d5da1',
            color: '#ffffff',
          },
        },
      },
    },
    MuiCard: {
      styleOverrides: {
        root: {
          backgroundColor: '#ffffff',
          border: '2px solid #2d2d2d',
          borderRadius: '225px 15px 255px 15px / 15px 255px 15px 225px',
          boxShadow: '3px 3px 0px 0px rgba(45, 45, 45, 0.1)',
          transition: 'all 0.1s ease',
          transform: 'rotate(-0.5deg)',
          '&:hover': {
            transform: 'rotate(0.5deg)',
            boxShadow: '6px 6px 0px 0px rgba(45, 45, 45, 0.2)',
          },
        },
      },
    },
    MuiTextField: {
      styleOverrides: {
        root: {
          '& .MuiOutlinedInput-root': {
            backgroundColor: '#ffffff',
            borderRadius: '255px 15px 225px 15px / 15px 225px 15px 255px',
            fontFamily: '"Patrick Hand", cursive',
            fontSize: '1.125rem',
            '& fieldset': {
              border: '2px solid #2d2d2d',
            },
            '&:hover fieldset': {
              borderColor: '#2d5da1',
            },
            '&.Mui-focused fieldset': {
              borderColor: '#2d5da1',
              boxShadow: '0 0 0 2px rgba(45, 93, 161, 0.2)',
            },
          },
          '& .MuiInputLabel-root': {
            fontFamily: '"Patrick Hand", cursive',
            fontSize: '1rem',
            color: 'rgba(45, 45, 45, 0.6)',
            '&.Mui-focused': {
              color: '#2d5da1',
            },
          },
        },
      },
    },
    MuiChip: {
      styleOverrides: {
        root: {
          borderRadius: '255px 15px 225px 15px / 15px 225px 15px 255px',
          fontFamily: '"Patrick Hand", cursive',
          border: '2px solid #2d2d2d',
          backgroundColor: '#fff9c4', // Post-it yellow
        },
      },
    },
    MuiPaper: {
      styleOverrides: {
        root: {
          borderRadius: '225px 15px 255px 15px / 15px 255px 15px 225px',
          border: '2px solid #2d2d2d',
        },
      },
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={handDrawnTheme}>
      <CssBaseline />
      <Box
        sx={{
          minHeight: '100vh',
          backgroundColor: '#fdfbf7', // Warm Paper
          backgroundImage: 'radial-gradient(#e5e0d8 1px, transparent 1px)', // Paper texture dots
          backgroundSize: '24px 24px',
          position: 'relative',
          '&::before': {
            content: '""',
            position: 'fixed',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            backgroundImage: `
              linear-gradient(90deg, transparent 0%, rgba(229, 224, 216, 0.3) 50%, transparent 100%),
              linear-gradient(0deg, transparent 0%, rgba(229, 224, 216, 0.2) 50%, transparent 100%)
            `,
            backgroundSize: '200px 200px, 150px 150px',
            pointerEvents: 'none',
            zIndex: 0,
          }
        }}
      >
        <Router>
          <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh', position: 'relative', zIndex: 1 }}>
            <Navbar />
            <Box component="main" sx={{ flexGrow: 1, p: 0 }}>
              <Routes>
                <Route path="/" element={<Navigate to="/dashboard" replace />} />
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/logs" element={<LogUpload />} />
                <Route path="/rules" element={<RuleManagement />} />
                <Route path="/scanner" element={<IaCScanner />} />
              </Routes>
            </Box>
          </Box>
        </Router>
      </Box>
    </ThemeProvider>
  );
}

export default App;
